tinymce.PluginManager.add('sepinsert', function (editor, url) {

    editor.ui.registry.addMenuButton('sepinsert', {
        text: 'Insert',
        fetch: function (callback) {
            var items = [
                {
                    type: 'menuitem',
                    text: 'Newest Content',
                    onAction: function () {
                        WYSIWYGFunctions("newestcontent", true, true);
                    }
                }, {
                    type: 'menuitem',
                    text: 'Widgets',
                    onAction: function () {
                        WYSIWYGFunctions("dynamicfunctions", true, true);
                    }
                }, {
                    type: 'menuitem',
                    text: 'RSS Feed',
                    onAction: function () {
                        WYSIWYGFunctions("rssfeed", true, true);
                    }
                }
            ];
            callback(items);
        }
    });

});